    false,nt"url": null,nt"notes": "This is the Reciprocal Fire Protection
    Agreement between the Silver Creek Rangeland Fire Protection Association and the
    Burns Interagency Fire Zone.  The objectives of the agreement are: to enhance the
    coordination and cooperation between the parties named in this agreement; to enhance
    and maximize the safety of all personnel and equipment involved in fire suppression
    and prescribed burning efforts; and to reduce the initial attack time and suppression
    costs by using the "closest forces concept."  Definitions, procedures, command
    structure, communications, liability, appropriation limitations, and cost sharing
    are all outlined in this agreement.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
